query blogPostQuery(
  $slug: String!
) {
  contentfulBlogPost(slug: {eq: $slug}) {
    id
    slug
    title
    subtitle
    published
    heroImage {
      id
      file {
        url
      }
    }
    bodyContent {
      bodyContent
    }
  }
}

query BlogPageQuery {
  allContentfulBlogPost {
    edges {
      node {
        id
        title
        slug
        subtitle
        published
        heroImage {
          file {
            url
            fileName
            contentType
          }
        }
        author {
          firstName
          lastName
          birthday
        }
      }
    }
  }
}
